function TableComp({ data }) {
    return (
        <>
            <table border={1}>
                <thead>
                    <tr>
                        {data.columns.map((column, i) => {
                            return <th key={i}>{column.header}</th>
                        })}
                    </tr>
                </thead>
                <tbody>
                    {data.rows.map((item, i) => {
                        return <tr key={i}>
                            <td>{item.cNumber}</td>
                            <td>{item.cName}</td>
                            <td>{item.cExpiry}</td>
                        </tr>
                    })}
                </tbody>
            </table>
        </>
    )
}
export default TableComp
